(10, 'Kontakt', 'Kontakt', 'Sie möchten Kontakt zu uns aufnehmen?', NULL, NULL, '<p>Sie ben&#246;tigen unsere Adresse? Oder eine Telefonnummer?<br />Hier haben wir alle Kontaktm&#246;glichkeiten f&#252;r Sie aufgelistet.</p>\r\n<h3>Anschrift</h3>\r\n<p>Verband Schweizer Opel H&#228;ndler<br /> Hohlenweg 11b<br /> 2564 Bellmund<br /> Schweiz</p>\r\n<h3>Telefon</h3>\r\n<p>+41 79 208 44 26</p>\r\n<h3>E-Mail</h3>\r\n<p><a href=\"mailto:info@vsoh.ch\">info@vsoh.ch</a></p>', 'de', '2018-11-26 10:10:28', '2019-01-20 17:40:20', NULL),
(10, 'Contact', 'Contact', 'You would like to contact us?', NULL, NULL, '<p>Do you need our address? Or a phone number?<br />Here we have listed all the contact information for you.</p>\r\n<h3>Address</h3>\r\n<p>Verband Schweizer Opel H&#228;ndler<br />Martin B&#228;chtold<br />Hohlenweg 11b<br />2564 Bellmund<br />Schweiz</p>\r\n<h3>Phone</h3>\r\n<p>+41 79 208 44 26</p>\r\n<h3>E-mail</h3>\r\n<p><a href=\"mailto:info@vsoh.ch\">info@vsoh.ch</a></p>', 'en', '2018-11-26 10:10:28', '2019-01-17 12:52:31', NULL),
(10, 'Contact', 'Contact', 'Souhaitez-vous nous contacter ?', NULL, NULL, '<p>Vous avez besoin de notre adresse ? Ou un num&#233;ro de t&#233;l&#233;phone ?<br />Nous avons list&#233; ici toutes les possibilit&#233;s de contact pour vous.</p>\r\n<h3>Adresse</h3>\r\n<p>Union Suisse Distributeurs Opel<br />Hohlenweg 11b<br />2564 Bellmund<br />Suisse</p>\r\n<h3>T&#233;l&#233;phone</h3>\r\n<p>+41 79 208 44 26</p>\r\n<h3>E-Mail</h3>\r\n<p><a href=\"mailto:info@vsoh.ch\">info@vsoh.ch</a></p>', 'fr', '2019-01-17 12:52:31', '2019-01-20 17:40:20', NULL),
