(18, 'Willkommen', 'Willkommen', NULL, NULL, NULL, '<h2><strong>Generelles</strong></h2>\r\n<p>Zweck des Verbandes Schweizer Opel H&#228;ndler&#160;ist die F&#246;rderung des Absatzes und der Wartung der Produkte von Opel&#160;in der Schweiz und im F&#252;rstentum Lichtenstein durch Wahrung der Interessen von leistungsf&#228;higen und wirtschaftlich gesunden H&#228;ndlern, Agenten und Servicepartnern.<br />Der &#246;ffentliche Bereich dieser Internetseite&#160;gibt Ihnen&#160;Ihnen einen &#220;berblick &#252;ber die Aufgabenstellung und den verschiedenen Fachkommissionen.<br /><br /><br />Der geschlossene Bereich dieser&#160;Plattform ist ein Kommunikationsmedium f&#252;r <strong>Opel</strong> Partner, die Mitglied unseres Verbandes sind.<br />Der Zugang zum geschlossenen Mitgliederbereich ist nur f&#252;r legitimierte Anwender unter Angabe von Benutzernamen und Passwort m&#246;glich.<br /><br />F&#252;r Fragen und&#160;Anregungen stehen wir Ihnen jederzeit gerne zur Verf&#252;gung.</p>', 'de', '2018-11-26 10:10:28', '2019-01-22 18:08:55', NULL),
(18, 'Welcome', 'Welcome', NULL, NULL, NULL, '<p>This platform is a communication medium for <strong>Opel</strong> partners that are members of our association.</p>\r\n<p>Access to the closed member area is only possible for legitimate users by entering their user name and password.</p>\r\n<p>If you have any questions or suggestions, please do not hesitate to contact us.</p>', 'en', '2018-11-26 10:10:28', '2019-01-17 12:55:40', NULL),
(18, 'Bienvenue', 'Bienvenue', NULL, NULL, NULL, '<h2>G&#233;n&#233;ral</h2>\r\n<p>Le but de L\'Union Suisse Distributeurs Opel&#160;est&#160;de promouvoir la vente et la maintenance des produits Opel en Suisse et dans la Principaut&#233; du Liechtenstein en d&#233;fendant les int&#233;r&#234;ts des concessionnaires, agents et partenaires de service efficaces et &#233;conomiquement sains.<br />L\'espace public de ce site vous donne un aper&#231;u des t&#226;ches et des diff&#233;rentes commissions.</p>\r\n<p><br />L\'espace ferm&#233; de cette plateforme est un moyen de communication pour les partenaires <strong>Opel,</strong> qui sont membres de notre association.<br />L\'acc&#232;s &#224; l\'espace membre ferm&#233; n\'est possible que pour les utilisateurs l&#233;gitimes en saisissant leur nom d\'utilisateur et leur mot de passe.</p>\r\n<p>Si vous avez des questions ou des suggestions, n\'h&#233;sitez pas &#224; nous contacter.</p>', 'fr', '2019-01-14 10:38:09', '2019-01-22 18:08:55', NULL),
