(25, 'Newsletter', 'Newsletter', 'Anmelden', NULL, NULL, '<h3>Aktuell informiert -<br />Newsletter</h3>\r\n<p>Sie interessieren sich f&#252;r die neuesten Infos aus der Welt des Automobils rund um&#160;Opel? Dann ist unser&#160;Newsletter genau das Richtige f&#252;r Sie.<br /><br />Freundliche Gr&#252;sse<br /><br />Martin B&#228;chtold</p>', 'de', '2018-11-26 10:10:28', '2019-01-18 14:57:23', NULL),
(25, 'Newsletter', 'Newsletter', 'Subscribe', NULL, NULL, '<h3>Stay tuned -<br /> Test Newsletter</h3>\r\n<p>Interested in the latest news on Opel?&#160;Then our newsletter is just the thing for you.</p>\r\n<p>Sincerelly<br /><br />Martin Baechtold</p>', 'en', '2018-11-26 10:10:28', '2019-01-17 13:38:22', NULL),
(25, 'Newsletter', 'Newsletter', 'S\'inscrire ', NULL, NULL, '<h3>Au courant de l\'&#233;volution de la situation -<br />Bulletin d\'information</h3>\r\n<p>&#202;tes-vous int&#233;ress&#233; par les derni&#232;res informations du monde de l\'automobile autour de&#160;Opel ? Alors notre newsletter est exactement ce qu\'il vous faut.</p>\r\n<p>Salutations amicales</p>\r\n<p>Martin B&#228;chtold</p>', 'fr', '2019-01-17 13:38:22', '2019-01-18 14:57:23', NULL),
(26, 'Newsletter', 'Newsletter', 'Abmelden', NULL, NULL, '<h3>Aktuell informiert -<br />der VSOH-Newsletter</h3>\r\n<p>Um sich vom Newsletter abzumelden, best&#228;tigen Sie dies bitte im nebenstehend Formular, indem Sie Ihre E-Mail angeben und&#160;den Anweisungen folgen.</p>\r\n<p>Freundliche Gr&#252;sse<br /><br />Martin B&#228;chtold</p>', 'de', '2018-11-26 10:10:28', '2019-01-18 14:58:16', NULL),
(26, 'Newsletter', 'Newsletter', 'Unsubscribe', NULL, NULL, '<h3>Stay tuned -<br /> VSOH Newsletter</h3>\r\n<p>You need to confirm your unsubscription from our newsletter by typing in your email in the form and following the instructions.</p>\r\n<p>Kind regards<br /><br />Martin Baechtold</p>', 'en', '2018-11-26 10:10:28', '2019-01-17 13:52:27', NULL),
(26, 'Newsletter', 'Newsletter', 'Annuler', NULL, NULL, '<h3>Au courant de l\'&#233;volution de la situation -<br />le bulletin d\'information&#160;VSOH</h3>\r\n<p>Pour vous d&#233;sabonner de la newsletter, veuillez le confirmer dans le formulaire ci-contre en saisissant votre adresse e-mail et en suivant les instructions.</p>\r\n<p>Meilleures salutations</p>\r\n<p>Martin B&#228;chtold</p>', 'fr', '2019-01-17 13:52:27', '2019-01-18 14:58:16', NULL),
