(546, 'Statuten des Verbandes', 'Statuten des Verbandes', NULL, NULL, NULL, '<h1><span class=\"subtitle\"><br /><img src=\"/mediafile/1806_logo_final_pfade.png\" alt=\"\" width=\"191\" height=\"45\" /><br /><br /><br /><strong><span class=\"subtitle\">Statuten des Verbandes Schweizer Opel H&#228;ndler&#160;&#160;&#160;</span></strong></span></h1>\r\n<h2><br /><br />Name und Sitz</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>1. Name, Sitz</strong><br />Unter der Bezeichnung &#8222;Verband Schweizer Opel H&#228;ndler&#8220; &#8222;Union Suisse Distributeurs Opel&#8220;, &#8222;Unione Svizzera Distributori Opel&#8220; besteht ein Verein im Sinne von Art. 60 ff ZGB, mit Sitz an der Adresse des Gesch&#228;ftsf&#252;hrers. Er ist im Handelsregister eingetragen.<br /><br /><strong>2. Zweck</strong><br />Zweck des Verbandes ist die F&#246;rderung des Absatzes und der Wartung der Produkte von Opel in der Schweiz und im F&#252;rstentum Lichtenstein durch Wahrung der In&#173;teres&#173;sen von leistungsf&#228;higen und wirtschaftlich gesunden H&#228;ndlern, Agenten und Service-Part&#173;nern.<br /><br /><br /></span></span>\r\n<h2>Mitgliedschaft</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>3. Mitglieder<br /></strong>Mitglieder des Verbandes k&#246;nnen alle Opel H&#228;ndler, Agenten und Service-Partner in der Schweiz und im F&#252;rstentum Lichtenstein werden, sofern sie einen entsprechenden Vertrag mit Opel abgeschlossen haben.<br /><br /><strong>4. Der Beitritt</strong><br />Beitrittsgesuche mit den n&#246;tigen Unterlagen werden an den Vorstand gerichtet, welcher sie mit einer Mehrheit von zwei Dritteln der anwesenden Vorstandmitglieder zu ge&#173;nehmigen hat. Der Vorstand kann ein Beitrittsgesuch &#8211; nach Anh&#246;rung des Gesuchstellers &#8211; ohne Begr&#252;n&#173;dung ablehnen.&#160;Ein ablehnender Entscheid des Vorstands kann innert 30 Tagen ab Empfang der ablehnen&#173;den Mit&#173;teilung schriftlich angefochten werden. Den endg&#252;ltigen Entscheid trifft die n&#228;chste ordent&#173;liche Mitgliederversammlung.<br /><br /><strong>5. Erl&#246;schen der Mitgliedschaft</strong><br />Die Mitgliedschaft erlischt:<br />-&#160;durch schriftliche Austrittserkl&#228;rung des Mitglieds an den Vorstand mindestens drei Mo&#173;nate im Voraus auf das Ende eines Kalenderjahres.<br />-&#160;bei Beendigung des Opel H&#228;ndler- bzw. Servicevertrages oder des Agenturver&#173;trages&#160;auf Ende des Kalender&#173;jahres.<br />-&#160;durch Entscheid des Vorstands, wobei die Angabe von Gr&#252;nden nicht n&#246;tig ist, das&#160;Mit&#173;glied jedoch vorg&#228;ngig anzuh&#246;ren ist. Das ausge&#173;schlossene Mitglied kann den&#160;Aus&#173;schluss innert 30 Tagen schriftlich anfechten. Den endg&#252;ltigen Entscheid trifft&#160;die n&#228;chste Mitgliederversammlung.<br />-&#160;durch Nichtbezahlung des Mitgliederbeitrags bis sp&#228;testens 31. Dezember des&#160;betreffenden Beitragsjahres.&#160;&#160;<br /><br /><br /></span></span>\r\n<h2>Finanzen und Haftung</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>6. Mittel</strong><br />Der Verband finanziert sich durch die Jahresbeitr&#228;ge der Mitglieder.<br /><br /><strong>7. Jahresbeitrag</strong><br />Der Jahresbeitrag besteht aus einem Basisbeitrag und einem Fahrzeugbeitrag, welche beide allj&#228;hrlich von der ordentlichen Mitgliederversammlung f&#252;r das betreffende Gesch&#228;ftsjahr festgelegt werden.&#160;Der j&#228;hrliche Basisbeitrag ist f&#252;r H&#228;ndler, Agenten und Service-Partner getrennt festzulegen, kann aber h&#246;chstens CHF 1&#8217;000.- betragen.&#160;Mitglieder mit einem H&#228;ndlervertrag bezahlen zus&#228;tzlich zum Basisbeitrag einen Fahr&#173;zeugbeitrag, welcher sich nach der Anzahl der vom Mitglied im letzten Jahr - auch &#252;ber Agenten verkauften - Opel-Neuwagen berechnet. Jedes Mitglied ist verpflichtet, diese Anzahl dem Vorstand genau anzugeben.&#160;Einbezahlte Betr&#228;ge werden auch bei Erl&#246;schen der Mitgliedschaft w&#228;hrend des Gesch&#228;fts&#173;jahres nicht pro rata zur&#252;ckbezahlt.<br /><br /><strong>8. Verm&#246;gen des Verbandes und pers&#246;nliche Haftung</strong><br />Ausscheidende Mitglieder haben keinen Anspruch auf das Verbandsverm&#246;gen.&#160;F&#252;r die Verbindlichkeiten des Verbands haftet ausschliesslich das Verbandsverm&#246;gen, unter Aus&#173;schluss jeder pers&#246;nlichen Haftbarkeit der Verbandsmitglieder.<br /><br /><strong>9. Rechnungsjahr</strong><br />Das Rechnungsjahr des Verbands beginnt jeweils am 1. Januar und endet am 31. Dezem&#173;ber.&#160;&#160;<br /><br /><br /></span></span>\r\n<h2>Organisation des Verbandes</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>10. Organe</strong><br />Die Organe des Verbands sind:<br />-&#160;die Mitgliederversammlung<br />-&#160;der Vorstand<br />-&#160;die Revisionsstelle<br /><br /><br /></span></span>\r\n<h2>Mitgliederversammlung</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>11. Einberufung der Mitgliederversammlung</strong><br />Die Mitgliederversammlung wird ordentlicherweise einmal j&#228;hrlich einberufen. Die Einla&#173;dung erfolgt schriftlich unter Bekanntgabe der Traktandenliste und mindestens 20 Tage im Voraus. Der Termin f&#252;r die ordentliche Mitgliederversammlung wird mindestens 40 Tage im Voraus bekannt gegeben.&#160;Antr&#228;ge an die Mitgliederversammlung, die dem Vorstand mindestens 30 Tage vor der Mit&#173;gliederversammlung schriftlich eingereicht werden, sind auf die Traktandenliste der Mit&#173;glie&#173;derversammlung zu setzen.&#160;Treffen Antr&#228;ge sp&#228;ter ein oder handelt es sich um blosse Anfragen, so sind sie an der Mit&#173;gliederversammlung unter &#8222;Varia&#8220; kurz zu besprechen.&#160;Ausserordentliche Mitgliederversammlungen werden auf Beschluss des Vor&#173;stan&#173;des einbe&#173;ru&#173;fen, wenn ein F&#252;nftel der Mitglieder des Verbands dies begehrt oder auf Verlangen der Revi&#173;sions&#173;stelle.&#160;Beschl&#252;sse k&#246;nnen in jedem Fall nur zu traktandierten Themen gef&#228;llt werden.<br /><br /><strong>12. Vorsitz und Protokoll</strong><br />Den Vorsitz an der Mitgliederversammlung f&#252;hrt der Pr&#228;sident, der Vizepr&#228;sident oder, wenn diese verhindert sind, ein anderes Mitglied des Vorstandes. &#220;ber die Verhandlung ist ein Be&#173;schlussprotokoll zu f&#252;hren.<br /><br /><strong>13. Befugnisse</strong><br />Der Mitgliederversammlung stehen abschliessend folgende Befugnisse zu:<br />-&#160;Wahl des Pr&#228;sidenten, des Vizepr&#228;sidenten sowie der &#252;brigen Vorstandsmitglieder und der Revisionsstelle;<br />-&#160;Wahl der Vertreter in das Franchise Board (OTC) von Opel, gem&#228;ss H&#228;ndler- und&#160;Servicever&#173;trag;<br />-&#160;Abnahme der T&#228;tigkeitsberichte, der Jahresrechnung und des Budgets;<br />-&#160;Festsetzung des Jahresbeitrags;<br />-&#160;Endentscheide &#252;ber Aufnahme oder Ausschluss eines Mitglieds;<br />-&#160;&#196;nderung der Statuten und Aufl&#246;sung des Verbandes.<br /><br /><strong>14. Beschlussfassung</strong><br />Jedes Mitglied hat in der Mitgliederversammlung mindestens eine Stimme. Die nach der H&#246;he des Jahresbeitrags gestaffelte Stimmrechts&#173;zuteilung wird in einem separaten Anhang geregelt.&#160;Stellvertretung durch ein anderes Mitglied ist gestattet, sofern eine schriftliche Vollmacht vorgelegt wird. Vorbehalten bleibt die gesetzliche Vertretung. &#220;ber die An&#173;erkennung einer Vollmacht entscheiden die an&#173;wesenden Mitglieder des Vorstandes. Ein Mitglied kann maxi&#173;mal zwei andere Mitglieder vertreten.&#160;Vorbeh&#228;ltlich besonderer Bestimmungen in den Statuten erfolgt die Beschlussfassung in offener Abstimmung mit dem einfachen Mehr der vertretenen Mitgliederstimmen. Wird ge&#173;heime Abstimmung oder Wahl mit einem Drittel der vertretenen Mitgliederstimmen verlangt, so sind diese geheim durchzuf&#252;hren.<br /><br /><strong>15. Statuten&#228;nderungen</strong><br />Statuten&#228;nderungen bed&#252;rfen einer Mehrheit von zwei Dritteln der vertretenen Mitglieder&#173;stimmen.<br /><br /><strong>16. Aufl&#246;sung des Verbands</strong><br />Die Aufl&#246;sung des Verbands kann durch Beschluss der Mitgliederversammlung mit einer Mehr&#173;heit von drei Vierteln der vertretenen Stimmen erfolgen. Mit der Aufl&#246;sung ist auch &#252;ber die Verwendung des Verbandsverm&#246;gens zu entscheiden.<br /><br /><br /></span></span>\r\n<h2>Vorstand</h2>\r\n<span class=\"norm\"><span class=\"norm\"><strong>17. Zusammensetzung und Organisation des Vorstandes</strong><br />Der Vorstand besteht aus mindestens sieben Personen.&#160;Die Vorstandsmitglieder werden f&#252;r eine Amtsdauer von einem Jahr gew&#228;hlt; Wiederwahl ist m&#246;glich. Der Pr&#228;sident und der Vizepr&#228;sident werden von der Mitgliederversammlung be&#173;stimmt, im &#220;brigen konstituiert sich der Vor&#173;stand selbst und regelt die Zeichnungsbe&#173;fug&#173;nisse.&#160;Der Vorstand amtet von einer ordentlichen Jahresversammlung zur andern. F&#228;llt w&#228;hrend des Jahres ein Vorstandsmitglied aus, so kann der Vorstand eine ausserordentliche Mit&#173;glie&#173;derversammlung einberufen, um eine Ersatzwahl vorzunehmen. F&#228;llt die Zahl der Vor&#173;standsmitglieder unter sieben, so muss eine solche Versammlung innert 60 Tagen durchge&#173;f&#252;hrt werden.&#160;Der Vorstand tagt so oft es die Gesch&#228;fte des Verbands erfordern. Zwei Mitglieder des Vorstandes k&#246;nnen die Durchf&#252;hrung einer Vorstandssitzung verlangen.&#160;<br /><br /><strong>18. Vorsitz und Protokoll</strong><br />Den Vorsitz in der Vorstandssitzung f&#252;hrt der Pr&#228;sident, der Vizepr&#228;sident oder, wenn diese verhin&#173;dert sind, ein anderes Mitglied des Vorstands. &#220;ber die Verhandlungen ist ein Proto&#173;koll zu f&#252;hren.<br /><br /><strong>19. Befugnisse des Vorstands und Delegation der Gesch&#228;ftsf&#252;hrung</strong><br />Der Vorstand f&#252;hrt die Angelegenheiten des Verbands und erledigt alle Gesch&#228;fte, sofern sie nicht ausdr&#252;cklich der Mitgliederversammlung zugewiesen sind. Er vertritt den Verband nach aussen, insbesondere gegen&#252;ber Opel, anderen Verb&#228;nden und Beh&#246;rden.&#160;Der Vorstand ist berechtigt und verpflichtet, die Interessen der Mitglieder als Opel- H&#228;ndler, Agenten und Service-Partner mit Nachdruck zu vertreten.&#160;Der Vorstand kann Aussch&#252;sse bilden und Spezialaufgaben delegieren. Er ist berechtigt, unter seiner Aufsicht einen Gesch&#228;ftsf&#252;hrer ganz oder teilweise mit der Gesch&#228;ftsf&#252;hrung und insbesondere auch mit der Vertretung der Verbandsinteressen sowie mit der F&#252;hrung eines Sekretariates zu beauftragen. Er bestimmt das Gesch&#228;ftsdomizil.<br /><br /><strong>20. Beschlussfassung</strong><br />Beschl&#252;sse des Vorstands erfolgen mit dem einfachen Mehr der Anwesenden, sofern in diesen Statuten nicht anderes vorgesehen ist. Der Vor&#173;stand ist beschlussf&#228;hig, wenn die Mehrheit seiner Mitglieder anwesend ist. Bei Stimmengleich&#173;heit hat der Vorsitzende den Stichentscheid.&#160;Sofern alle Vorstandmitglieder ihr Einverst&#228;ndnis geben und keines eine Sitzung verlangt, k&#246;nnen Beschl&#252;sse auch im Zirkulationsverfahren getroffen werden. Sie sind in das Protokoll der n&#228;chsten Vorstandssitzung aufzunehmen.&#160;Stellvertretung im Vorstand ist ausgeschlossen.<br /><br />&#160;</span></span>\r\n<h2>Revisionsstelle</h2>\r\n<span class=\"norm\"><strong>21. Revisionsstelle</strong><br />Die Mitgliederversammlung w&#228;hlt jedes Jahr einen B&#252;cherexperten oder eine Revisionsge&#173;sellschaft als Revisionsstelle, die die Jahresrechnung &#252;berpr&#252;ft und der Mitgliederver&#173;samm&#173;lung &#252;ber das Ergebnis der Pr&#252;fung Bericht erstattet und Antrag stellt.<br /><br /><br /><br />Die Statuten&#228;nderungen wurden anl&#228;sslich der Mitgliederversammlung vom 15. Juni 2018 genehmigt und sind sofort in Kraft getreten.<br /><br /><br /><br />Ort und Datum:&#160;Bellmund, 15. Juni 2018&#160;&#160;<br /><br /><br />Der Pr&#228;sident:&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; Der Vizepr&#228;sident:<br /><br />Hubert Waeber&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; Patrick Germann</span>', 'de', '2018-11-26 10:10:28', '2019-01-22 22:11:46', NULL),
(546, 'Partner', 'Partner', NULL, NULL, NULL, NULL, 'en', '2018-11-26 10:10:28', '2018-11-26 10:10:28', NULL),
(546, 'Statuts de l\'Union', 'Statuts de l\'Union', NULL, NULL, NULL, '<h1><strong><span class=\"subtitle\"><span class=\"subtitle\"><img style=\"width: 191px; height: 41px;\" src=\"/mediafile/1806_logo_final_pfade.png\" alt=\"\" width=\"191\" height=\"45\" /></span></span><br /><br /><br />Statuts de l\'union Suisse Distributeurs Opel<br /><br /><br /></strong></h1>\r\n<h2><strong>Nom et si&#232;ge</strong></h2>\r\n<p><strong><br />1. Nom, si&#232;ge</strong><br />Sous la d&#233;nomination &#8222;Verband Schweizer Opel H&#228;ndler&#8220; &#8222;Union Suisse Distributeurs Opel&#8220;, &#8222;Unione Svizzera Distributori Opel&#8220; existe une association au sens des articles 60 ss du Code civil, dont le si&#232;ge est &#224; l&#8217;adresse du g&#233;rant. Elle est inscrite au registre du commerce.</p>\r\n<p><strong>2. But</strong><br />Le but de l&#8217;Union est de promouvoir la distribution et l&#8217;entretien des produits d&#8217;Opel en Suisse et dans la Principaut&#233; du Lichtenstein par la protection des int&#233;r&#234;ts de distributeurs, agents et partenaires de service performants et &#233;conomiquement solides.</p>\r\n<p>&#160;</p>\r\n<h2><strong>Qualit&#233; de membre</strong></h2>\r\n<p><strong><br />3. Membres</strong><br />Tous les distributeurs, agents et partenaires de service Opel en Suisse et dans la Principaut&#233; du Lichtenstein peuvent devenir membres de l&#8217;Union, dans la mesure o&#249; ils ont conclu un contrat correspondant avec Opel.</p>\r\n<p>&#160;<strong>4. Adh&#233;sion</strong><br />Les demandes d&#8217;adh&#233;sion sont adress&#233;es avec les documents n&#233;cessaires au comit&#233; directeur, lequel doit les approuver &#224; la majorit&#233; des deux tiers des membres pr&#233;sents. Le comit&#233; directeur peut, apr&#232;s avoir entendu le requ&#233;rant, refuser une adh&#233;sion sans motivation de sa d&#233;cision.</p>\r\n<p>Une d&#233;cision de refus du comit&#233; directeur peut &#234;tre contest&#233;e par &#233;crit dans les 30 jours d&#232;s r&#233;ception de la communication du refus. La prochaine assembl&#233;e g&#233;n&#233;rale ordinaire statue d&#233;finitivement.&#160;</p>\r\n<p><strong>5. Perte de la qualit&#233; de membre</strong><br />La qualit&#233; de membre s&#8217;&#233;teint:</p>\r\n<ul>\r\n<li>\r\n<p>&#224; la remise d&#8217;une d&#233;mission &#233;crite au comit&#233; directeur, au moins trois mois avant la fin d&#8217;une ann&#233;e civile.</p>\r\n</li>\r\n<li>\r\n<p>&#224; la fin de l&#8217;ann&#233;e civile pendant laquelle le contrat de distribution, respectivement de service avec Opel ou le contrat d&#8217;agence du membre en question prend fin.</p>\r\n</li>\r\n<li>\r\n<p>par d&#233;cision du comit&#233; directeur, sans que la motivation de la d&#233;cision ne soit n&#233;cessaire, le membre devant cependant &#234;tre entendu auparavant. Le membre&#160;exclu peut contester l&#8217;exclusion par &#233;crit dans les 30 jours. La prochaine assembl&#233;e&#160;g&#233;n&#233;rale statue d&#233;finitivement.</p>\r\n</li>\r\n<li>\r\n<p>par le non-paiement de la cotisation de membre jusqu&#8217;au 31 d&#233;cembre au plus tard&#160;de l&#8217;ann&#233;e civile en cours.</p>\r\n</li>\r\n</ul>\r\n<p>&#160;</p>\r\n<h2><strong>Finances et responsabilit&#233;</strong></h2>\r\n<p><strong><br />6. Ressources</strong><br />L&#8217;Union se finance par les cotisations annuelles de ses membres.</p>\r\n<p><strong>7. Cotisation anuelle</strong><br />La cotisation annuelle se compose d&#8217;un montant de base et d&#8217;une cotisation-v&#233;hicule, qui sont les deux fix&#233;s annuellement par l&#8217;assembl&#233;e g&#233;n&#233;rale pour l&#8217;exercice concern&#233;.&#160;</p>\r\n<p>Le montant de base annuel est fix&#233; s&#233;par&#233;ment pour les distributeurs, les agents et les partenaires de service, mais ne peut d&#233;passer CHF 1000.-.</p>\r\n<p>Les membres qui ont un contrat de distribution paient en compl&#233;ment &#224; la cotisation de base une cotisation-v&#233;hicule, laquelle se calcule d&#8217;apr&#232;s le nombre de nouvelles voitures Opel vendues l&#8217;ann&#233;e derni&#232;re par le membre, y compris &#224; travers ses agents. Chaque membre est tenu de d&#233;clarer ce montant de fa&#231;on exacte au comit&#233; directeur.&#160;</p>\r\n<p>Les cotisations d&#233;j&#224; pay&#233;es ne seront pas rembours&#233;s au pro rata, m&#234;me en cas de perte de la qualit&#233; de membre durant l&#8217;exercice en cours.</p>\r\n<p><strong>8. Patrimoine de l\'Union et responsabilit&#233; personnelle</strong><br />Les membres sortants n&#8217;ont aucun droit sur le patrimoine de l&#8217;Union.</p>\r\n<p>Le patrimoine de l&#8217;Union r&#233;pond seul des obligations de l&#8217;Union. Toute responsabilit&#233; personnelle des membres de l&#8217;Union est exclue.</p>\r\n<p><strong>9. L\'exercice commercial</strong><br />L&#8217;exercice commercial de l&#8217;Union commence chaque ann&#233;e le 1er janvier et se termine le 31 d&#233;cembre.</p>\r\n<p>&#160;</p>\r\n<h2><strong>Organisation de l&#8217;Union</strong></h2>\r\n<p><strong><br />10. Organes</strong><br />Les organes de l&#8217;Union sont&#160;:</p>\r\n<ul>\r\n<li>\r\n<p>l\'assembl&#233;e g&#233;n&#233;rale</p>\r\n</li>\r\n<li>\r\n<p>le comit&#233; directeur</p>\r\n</li>\r\n<li>\r\n<p>l&#8217;organe de r&#233;vision</p>\r\n</li>\r\n</ul>\r\n<p>&#160;</p>\r\n<h2><strong>Assembl&#233;e g&#233;n&#233;rale</strong></h2>\r\n<p><strong>11. Convoction de l\'assembl&#233;e g&#233;n&#233;rale</strong><br />L&#8217;assembl&#233;e g&#233;n&#233;rale ordinaire est convoqu&#233;e une fois par ann&#233;e. L&#8217;invitation est faite par &#233;crit au moins 20 jours &#224; l&#8217;avance et comprend l&#8217;annonce de l&#8217;ordre du jour. La date de l&#8217;assembl&#233;e g&#233;n&#233;rale est communiqu&#233;e au minimum 40 jours &#224; l&#8217;avance.</p>\r\n<p>Les requ&#234;tes adress&#233;es &#224; l&#8217;assembl&#233;e g&#233;n&#233;rale, pour autant qu&#8217;elles parviennent par &#233;crit au comit&#233; directeur au minimum 30 jours avant l&#8217;assembl&#233;e g&#233;n&#233;rale, doivent &#234;tre port&#233;es &#224; l&#8217;ordre du jour de l&#8217;assembl&#233;e g&#233;n&#233;rale.</p>\r\n<p>Les requ&#234;tes tardives ainsi que les simples questions seront bri&#232;vement discut&#233;es &#224; l&#8217;assembl&#233;e g&#233;n&#233;rale sous&#160;&#171;&#160;divers&#160;&#187;.</p>\r\n<p>Les assembl&#233;es g&#233;n&#233;rales extraordinaires sont convoqu&#233;es sur d&#233;cision du comit&#233; directeur, lorsqu&#8217;un cinqui&#232;me des membres de l&#8217;Union le demande ou sur requ&#234;te de l&#8217;organe de r&#233;vision.</p>\r\n<p>En toutes circonstances, des d&#233;cisions ne peuvent &#234;tre prises que sur des objets port&#233;s &#224; l&#8217;ordre du jour.</p>\r\n<p><strong>12. Pr&#233;sidence et proc&#232;s-verbal</strong><br />La pr&#233;sidence &#224; l&#8217;assembl&#233;e g&#233;n&#233;rale est exerc&#233;e par le pr&#233;sident, le vice-pr&#233;sident ou, lorsque ceux-ci sont emp&#234;ch&#233;s, un autre membre du comit&#233; directeur. Un proc&#232;s-verbal est dress&#233; sur les d&#233;bats.&#160;</p>\r\n<p><strong>13. Attribution</strong><br />L&#8217;assembl&#233;e g&#233;n&#233;rale a de fa&#231;on limitative les attributions suivantes&#160;:</p>\r\n<ul>\r\n<li>\r\n<p>&#233;lection du pr&#233;sident, du vice-pr&#233;sident et des autres membres du comit&#233; directeur ainsi que de l&#8217;organe de r&#233;vision&#160;;</p>\r\n</li>\r\n<li>\r\n<p>&#233;lection des repr&#233;sentants aupr&#232;s du &#171;&#160;Franchise Board&#160;&#187; (OTC) d&#8217;Opel, selon les contrats de distribution et de service&#160;;</p>\r\n</li>\r\n<li>\r\n<p>approbation des rapports d&#8216;activit&#233;, des comptes annuels et du budget&#160;;</p>\r\n</li>\r\n<li>\r\n<p>fixation de la cotisation annuelle&#160;;</p>\r\n</li>\r\n<li>\r\n<p>d&#233;cision d&#233;finitive concernant l&#8217;adh&#233;sion et l&#8217;exclusion de membres&#160;;</p>\r\n</li>\r\n<li>\r\n<p>changement des statuts et dissolution de l&#8217;Union.</p>\r\n</li>\r\n</ul>\r\n<p><strong>14. D&#233;cisions</strong><br />A l&#8217;assembl&#233;e g&#233;n&#233;rale, chaque membre a droit au moins &#224; une voix. L&#8217;attribution du droit de vote en fonction de la cotisation annuelle sera r&#233;gl&#233;e dans une annexe s&#233;par&#233;e.</p>\r\n<p>La repr&#233;sentation par un autre membre est autoris&#233;e, si une procuration &#233;crite est pr&#233;sent&#233;e. La repr&#233;sentation l&#233;gale est r&#233;serv&#233;e. Les membres du comit&#233; directeur pr&#233;sents d&#233;cident de la reconnaissance d&#8217;une procuration. Un membre peut repr&#233;senter au maximum deux autres membres.</p>\r\n<p>Sous r&#233;serve de dispositions sp&#233;ciales dans les statuts, les d&#233;cisions sont prises en votation ouverte &#224; la majorit&#233; simple des voix repr&#233;sent&#233;es. Si un tiers des voix repr&#233;sent&#233;es l&#8217;exige, la votation ou l&#8217;&#233;lection se fera de mani&#232;re secr&#232;te.</p>\r\n<p><strong>15. Changements des statuts</strong><br />Les changements des statuts n&#233;cessitent une majorit&#233; de deux tiers des voix repr&#233;sent&#233;es.</p>\r\n<p><strong>16. Dissolution</strong><br />L&#8217;Union peut &#234;tre dissoutepar d&#233;cision de l&#8217;assembl&#233;e g&#233;n&#233;rale &#224; la majorit&#233; des trois quarts des voix repr&#233;sent&#233;es. L&#8217;affection du patrimoine de l&#8217;Union doit &#234;tre d&#233;cid&#233;e en m&#234;me temps que sa dissolution.</p>\r\n<p>&#160;</p>\r\n<h2><strong>Comit&#233; directeur</strong></h2>\r\n<p><strong><br />17. Constitution et organisation du comit&#233; directeur</strong><br />Le comit&#233; directeur est compos&#233; d&#8217;au moins sept personnes.</p>\r\n<p>Les membres du comit&#233; directeur sont &#233;lus &#224; leur fonction pour une dur&#233;e d&#8217;une ann&#233;e&#160;; la r&#233;&#233;lection est possible. Le pr&#233;sident et le vice-pr&#233;sident sont &#233;lus par l&#8217;assembl&#233;e g&#233;n&#233;rale. Par ailleurs le comit&#233; directeur se constitue lui-m&#234;me et r&#232;gle les droits de signature.</p>\r\n<p>Le comit&#233; directeur reste en fonction d&#8217;une assembl&#233;e annuelle ordinaire &#224; l&#8217;autre. En cas de d&#233;part d&#8217;un membre du comit&#233; en cours d&#8217;ann&#233;e, le comit&#233; directeur peut convoquer une assembl&#233;e g&#233;n&#233;rale extraordinaire, afin de proc&#233;der &#224; une &#233;lection de remplacement. Si le nombre des membres du comit&#233; directeur tombe en dessous de sept, une telle assembl&#233;e doit avoir lieu dans les 60 jours.</p>\r\n<p>Le comit&#233; directeur se r&#233;unit aussi souvent que les affaires de l&#8217;Union l&#8217;exigent. Deux membres du comit&#233; directeur peuvent exiger la tenue d&#8217;une s&#233;ance.</p>\r\n<p><strong>18. La pr&#233;sidence</strong><br />La pr&#233;sidence de la s&#233;ance du comit&#233; directeur est exerc&#233;e par le pr&#233;sident, le vice-pr&#233;sident ou, lorsque ceux-ci sont emp&#234;ch&#233;s, un autre membre du comit&#233; directeur. Un proc&#232;s-verbal est dress&#233; sur les d&#233;bats.</p>\r\n<p><strong>19. Attribution du comit&#233; et d&#233;l&#233;gation de la gestion</strong><br />Le comit&#233; directeur dirige les affaires de l&#8217;Union et s&#8217;occupe de toutes les activit&#233;s, &#224; moins qu&#8217;elles ne soient express&#233;ment attribu&#233;es &#224; l&#8217;assembl&#233;e g&#233;n&#233;rale. Il repr&#233;sente l\'Union &#224; l&#8217;&#233;gard des tiers, particuli&#232;rement face &#224; Opel, &#224; d\'autres associations et aux autorit&#233;s.</p>\r\n<p>Il est le devoir du comit&#233; directeur de repr&#233;senter avec vigueur les int&#233;r&#234;ts des membres comme distributeurs, agents et partenaires de service Opel.</p>\r\n<p>Le comit&#233; directeur peut constituer des commissions et d&#233;l&#233;guer des t&#226;ches sp&#233;ciales. Il est autoris&#233; &#224; charger, sous sa surveillance, totalement ou partiellement un g&#233;rant de la gestion et particuli&#232;rement de la repr&#233;sentation des int&#233;r&#234;ts de l&#8217;Union comme de la conduite d\'un secr&#233;tariat. Il d&#233;termine le domicile commercial.</p>\r\n<p><strong>20. D&#233;cisions</strong><br />Les d&#233;cisions du comit&#233; directeur sont prises &#224; la majorit&#233; simple des personnes pr&#233;sentes, &#224; moins que ces statuts ne pr&#233;voient autre chose. Le comit&#233; directeur peut d&#233;lib&#233;rer valablement lorsque la majorit&#233; de ses membres est pr&#233;sente. En cas d&#8217;&#233;galit&#233; de voix, la voix du pr&#233;sident est pr&#233;pond&#233;rante.</p>\r\n<p>Si tous les membres du comit&#233; directeur ont donn&#233; leur accord et qu&#8217;aucun n&#8217;exige une s&#233;ance, les d&#233;cisions peuvent aussi &#234;tre prises par voie circulaire. Elles doivent figurer au proc&#232;s-verbal de la prochaine s&#233;ance du comit&#233; directeur.</p>\r\n<p>La repr&#233;sentation dans le comit&#233; directeur est exclue.<br /><br />&#160;</p>\r\n<h2><strong>Organe de r&#233;vision</strong></h2>\r\n<p><strong><br />21. Organe de r&#233;vision</strong><br />L&#8217;assembl&#233;e g&#233;n&#233;rale &#233;lit chaque ann&#233;e un expert-comptable ou une soci&#233;t&#233; d&#8217;expertise comme organe de r&#233;vision, laquelle contr&#244;le les comptes annuels, rapporte &#224; l\'assembl&#233;e g&#233;n&#233;rale le r&#233;sultat de sa v&#233;rification et lui soumet une proposition quant &#224; l\'approbation des comptes.</p>\r\n<p><br /><br /></p>\r\n<p>Ces statuts ont &#233;t&#233; approuv&#233;s lors de l&#8217;assembl&#233;e g&#233;n&#233;rale du 15 juin 2018 et sont imm&#233;diatement entr&#233;s en vigueur.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Lieu et date&#160;:</p>\r\n<p>&#160;</p>\r\n<p>Bellmund, 15 juin 2018</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Le pr&#233;sident&#160;:&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; le vice-pr&#233;sident&#160;:<br /><br /><br /><br />Hubert Waeber&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; &#160; Patrick Germann&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;</p>\r\n<h1><span class=\"subtitle\"><span class=\"subtitle\"><br /><br /><br /></span><br /><span class=\"subtitle\"><strong><br /><br /></strong></span></span></h1>\r\nXX', 'fr', '2019-01-17 14:56:25', '2019-01-23 13:21:44', NULL),
