(5, '{CONTENT}\r\nHallo,\r\n\r\nSie haben am {CURRENT_DATE} um {CURRENT_TIME} eine Anfrage über das Kontaktformular erhalten.', '{CONTENT}\r\n<p>Hallo,</p>\r\n<p>Sie haben am {CURRENT_DATE} um {CURRENT_TIME} eine Anfrage über das Kontaktformular erhalten.</p>', 'de', '2019-01-13 20:19:55', '2019-01-20 10:41:23', NULL),
