INSERT INTO `site_rights_translation` (`id`, `email_text_plain`, `email_text_html`, `website_text_html`, `lang`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, NULL, NULL, '<h2>Kontaktadresse</h2>\r\n<p>Verband Schweizer Opel H&#228;ndler<br /> Hohlenweg 11b<br /> 2564 Bellmund<br /> Schweiz</p>\r\n<h2>Vertretungsberechtigte Personen</h2>\r\n<p>Martin B&#228;chtold<br /><a href=\"mailto:info@vsoh.ch\"> info@vsoh.ch</a></p>\r\n<h2>Haftungsausschluss</h2>\r\n<p>Der Autor &#252;bernimmt keinerlei Gew&#228;hr hinsichtlich der inhaltlichen Richtigkeit, Genauigkeit, Aktualit&#228;t, Zuverl&#228;ssigkeit und Vollst&#228;ndigkeit der Informationen.</p>\r\n<p>Haftungsanspr&#252;che gegen den Autor wegen Sch&#228;den materieller oder immaterieller Art, welche aus dem Zugriff oder der Nutzung bzw. Nichtnutzung der ver&#246;ffentlichten Informationen, durch Missbrauch der Verbindung oder durch technische St&#246;rungen entstanden sind, werden ausgeschlossen.</p>\r\n<p>Alle Angebote sind unverbindlich. Der Autor beh&#228;lt es sich ausdr&#252;cklich vor, Teile der Seiten oder das gesamte Angebot ohne gesonderte Ank&#252;ndigung zu ver&#228;ndern, zu erg&#228;nzen, zu l&#246;schen oder die Ver&#246;ffentlichung zeitweise oder endg&#252;ltig einzustellen.</p>\r\n<h2>Haftung f&#252;r Links</h2>\r\n<p>Verweise und Links auf Webseiten Dritter liegen ausserhalb unseres Verantwortungsbereichs Es wird jegliche Verantwortung f&#252;r solche Webseiten abgelehnt. Der Zugriff und die Nutzung solcher Webseiten erfolgen auf eigene Gefahr des Nutzers oder der Nutzerin.</p>\r\n<h2>Urheberrechte</h2>\r\n<p>Die Urheber- und alle anderen Rechte an Inhalten, Bildern, Fotos oder anderen Dateien auf der Website geh&#246;ren ausschliesslich dem Verband Schweizer Opel H&#228;ndler oder den speziell genannten Rechtsinhabern. F&#252;r die Reproduktion jeglicher Elemente ist die schriftliche Zustimmung der Urheberrechtstr&#228;ger im Voraus einzuholen.</p>', 'de', '2018-11-26 10:10:41', '2019-01-18 08:22:16', NULL),
(1, NULL, NULL, '<p>On this page, an imprint should be stored. Why not try out the <a class=\"external\" href=\"http://www.e-recht24.de/impressum-generator.html\">imprint generator</a> of eRecht24.</p>', 'en', '2018-11-26 10:10:41', '2018-11-30 13:42:29', NULL),
(1, NULL, NULL, '<h2>Adresse de contact</h2>\r\n<p>Union Suisse Distributeurs Opel<br />Hohlenweg 11b<br />2564 Bellmund<br />Suisse<br /><br /></p>\r\n<h2>Repr&#233;sentant autoris&#233;s</h2>\r\n<p>Martin B&#228;chtold<br /><a href=\"mailto:info@vsoh.ch\">info@vsoh.ch</a></p>\r\n<h2><br />D&#233;n&#233;gation de responsabilit&#233;</h2>\r\n<p>L\'auteur d&#233;cline toute responsabilit&#233; quant &#224; l\'exactitude, la pr&#233;cision, l\'actualit&#233;, la fiabilit&#233; et l\'exhaustivit&#233; des informations mises &#224; disposition.</p>\r\n<p>La responsabilit&#233; de l\'auteur est exclue en cas de dommages mat&#233;riels ou immat&#233;riels r&#233;sultant de l\'acc&#232;s, de l\'utilisation ou de la non-utilisation des informations publi&#233;es, d\'une mauvaise utilisation de la connexion ou de d&#233;faillances techniques.</p>\r\n<p>Toutes les offres sont sans engagement. L\'auteur se r&#233;serve express&#233;ment le droit de modifier, de compl&#233;ter ou d\'effacer des parties des pages ou l\'ensemble de l\'offre sans avis pr&#233;alable ou de cesser temporairement ou d&#233;finitivement la publication.</p>\r\n<h2><br />Responsabilit&#233; pour les liens</h2>\r\n<p>Les r&#233;f&#233;rences et liens vers des sites Internet de tiers ne rel&#232;vent pas de notre responsabilit&#233; et nous d&#233;clinons toute responsabilit&#233; quant &#224; ces sites Internet. L\'acc&#232;s &#224; ces sites Web et leur utilisation se font aux risques et p&#233;rils de l\'utilisateur.<br /><br /></p>\r\n<h2>Droits d\'auteur</h2>\r\n<p>Les droits d\'auteur et tous les autres droits sur le contenu, les images, les photographies ou autres fichiers du site Internet appartiennent exclusivement &#224; l\'Association suisse des concessionnaires Opel ou aux ayants droit express&#233;ment d&#233;sign&#233;s. La reproduction de tout &#233;l&#233;ment doit faire l\'objet d\'une autorisation &#233;crite pr&#233;alable du d&#233;tenteur des droits d\'auteur.</p>\r\n<h2>&#160;</h2>\r\nXX', 'fr', '2019-01-18 08:22:16', '2019-01-20 16:52:05', NULL),
(2, NULL, NULL, '<h1>Datenschutzerkl&#228;rung</h1>\r\n<p>Wir freuen uns, dass Sie unsere Webseiten besuchen und die Leistungen des Verbandes Schweizer Opel H&#228;ndler (VSOH) in Anspruch nehmen wollen.</p>\r\n<p>Der Schutz Ihrer Privatsph&#228;re bei der Nutzung unserer Webseiten ist uns wichtig. Daher nehmen Sie bitte nachstehende Informationen zur Kenntnis:</p>\r\n<h2>1. Datenerhebung</h2>\r\n<p>Da wir unsere Leistungen nur gegen&#252;ber einem exklusiven Benutzerkreis erbringen, k&#246;nnen Sie die Webseiten des VSOH nur besuchen, wenn Sie uns mitteilen, wer Sie sind. Daneben erfahren wir den Namen Ihres Internet Service Providers, die Webseite, von der aus Sie uns besuchen, und die Webseiten, die Sie bei uns besuchen. Diese Informationen werden zu statistischen Zwecken ausgewertet. Dabei bleiben Sie als einzelner Nutzer anonym.</p>\r\n<h2>2. Erhebung und Verarbeitung personenbezogener Daten</h2>\r\n<p>Personenbezogene Daten werden nur erhoben, wenn Sie uns diese von sich aus, zum Beispiel zur Durchf&#252;hrung eines Vertrages, einer Umfrage oder bei der Registrierung f&#252;r personalisierte Dienste mitteilen. Im Rahmen der personalisierten Dienste vom VSOH werden Ihre Registrierungsdaten unter der Voraussetzung Ihrer Einwilligung zum Zwecke von Werbung und Marktforschung sowie zur bedarfsgerechten Gestaltung elektronischer Dienste verarbeitet. Ihre Daten werden innerhalb der Schweiz verarbeitet.</p>\r\n<h2>3. Nutzung und Weitergabe personenbezogener Daten</h2>\r\n<p>Die im Rahmen der Webseiten des VSOH erhobenen personenbezogenen Daten werden ohne Ihre Einwilligung nur zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen genutzt. Dar&#252;ber hinaus erfolgt eine Nutzung Ihrer Daten f&#252;r Zwecke der Werbung und Marktforschung sowie zur bedarfsgerechten Gestaltung der elektronischen Dienste des VSOH nur, wenn Sie hierzu zuvor Ihre Einwilligung erteilt haben.</p>\r\n<p>Da die Einwilligung in die Nutzung Ihrer Daten in die vorgenannten Zwecke auch die &#220;bermittlung Ihrer Daten an die Partnergesellschaften des VSOH und an die von VSOH beauftragten Leistungserbringer umfassen kann, k&#246;nnen Ihre Daten auch an diese Stellen weitergegeben werden. Im &#220;brigen findet keine Weitergabe an sonstige Dritte statt. Ihre jeweilige Einwilligung k&#246;nnen Sie selbstverst&#228;ndlich jederzeit mit Wirkung f&#252;r die Zukunft widerrufen.</p>\r\n<p>Auskunftsersuchen zu Ihren Daten und Anregungen k&#246;nnen Sie jederzeit per E-Mail oder Brief an die unter Kontakt genannte Adresse senden.</p>', 'de', '2018-11-26 10:10:41', '2018-11-30 13:23:23', NULL),
(2, NULL, NULL, '<p>On this page everything should be stored on data protection. Why not try out the <a class=\"external\" href=\"http://www.e-recht24.de/impressum-generator.html\">imprint generator</a> of eRecht24.</p>', 'en', '2018-11-26 10:10:41', '2018-11-30 13:23:23', NULL),
(2, NULL, NULL, '<h1>D&#233;claration de confidentialit&#233;</h1>\r\n<p>Nous nous r&#233;jouissons de votre visite sur notre site Internet et souhaitons b&#233;n&#233;ficier des services de l\'Union Suisse desitributeurs Opel&#160;(VSOH).</p>\r\n<p>La protection de votre vie priv&#233;e lors de l\'utilisation de notre site Web est importante pour nous. Veuillez donc prendre note des informations suivantes:<br /><br /></p>\r\n<h2>1. Collecte de donn&#233;es</h2>\r\n<p>Comme nous ne fournissons nos services qu\'&#224; un groupe exclusif d\'utilisateurs, vous ne pouvez visiter les sites Web de VSOH que si vous nous dites qui vous &#234;tes. Nous apprenons &#233;galement le nom de votre fournisseur d\'acc&#232;s Internet, le site Web &#224; partir duquel vous nous visitez et les pages de notre site Web que vous visitez. Ces informations sont exploit&#233;es &#224; des fins statistiques. Vous restez anonyme en tant qu\'utilisateur individuel.<br /><br /></p>\r\n<h2>2. La collecte et le traitement des donn&#233;es &#224; caract&#232;re personnel</h2>\r\n<p>Les donn&#233;es personnelles ne sont collect&#233;es que si vous nous les fournissez volontairement, par exemple pour l\'ex&#233;cution d\'un contrat, d\'un sondage ou lors de l\'inscription &#224; des services personnalis&#233;s. Dans le cadre des services personnalis&#233;s de VSOH, vos donn&#233;es d\'inscription seront trait&#233;es, sous r&#233;serve de votre consentement, &#224; des fins publicitaires et d\'&#233;tude de march&#233; ainsi que pour la conception de services &#233;lectroniques en fonction des besoins. Vos donn&#233;es seront trait&#233;es en Suisse.<br /><br /></p>\r\n<h2>3. L\'utilisation et la divulgation des donn&#233;es personnelles</h2>\r\n<p>Les donn&#233;es personnelles collect&#233;es sur le site Web de VSOH ne seront utilis&#233;es sans votre consentement que pour le traitement contractuel et le traitement de vos demandes. En outre, vos donn&#233;es ne seront utilis&#233;es qu\'&#224; des fins publicitaires et d\'&#233;tudes de march&#233; et pour concevoir les services &#233;lectroniques de la VSOH afin de r&#233;pondre &#224; vos besoins si vous nous avez donn&#233; votre consentement pr&#233;alable.</p>\r\n<p>Etant donn&#233; que le consentement &#224; l\'utilisation de vos donn&#233;es aux fins susmentionn&#233;es peut &#233;galement inclure le transfert de vos donn&#233;es aux entreprises partenaires de VSOH et aux prestataires de services mandat&#233;s par VSOH, vos donn&#233;es peuvent &#233;galement &#234;tre transmises &#224; ces parties. Pour le reste, aucune transmission &#224; des tiers n\'a lieu. Bien entendu, vous pouvez &#224; tout moment r&#233;voquer votre consentement respectif avec effet pour l\'avenir.</p>\r\n<p>Vous pouvez &#224; tout moment envoyer vos demandes d\'information sur vos donn&#233;es et suggestions par e-mail ou par courrier &#224; l\'adresse indiqu&#233;e sous Contact.</p>', 'fr', '2019-01-18 08:22:25', '2019-01-20 16:52:23', NULL),
(3, NULL, NULL, '<h1>Nutzungsbedingungen</h1>\r\n<h2>1. Allgemeines</h2>\r\n<p>Diese Web-Site ist Gegenstand der nachfolgenden Nutzungsbedingungen, die im Verh&#228;ltnis zwischen Nutzer und dem Verband Schweizer Opel H&#228;ndler (nachfolgend Diensteanbieter genannt) mit dem Aufruf dieser Web-Site verbindlich vereinbart sind. Soweit spezielle Bedingungen f&#252;r einzelne Nutzungen dieser Web-Site von den Nutzungsbedingungen abweichen, wird in der Web-Site an entsprechender Stelle ausdr&#252;cklich darauf hingewiesen. Es gelten dann im jeweiligen Einzelfall erg&#228;nzend die besonderen Nutzungsbedingungen.<br /><br /></p>\r\n<h2>2. Herunterladen / Vervielf&#228;ltigung</h2>\r\n<p>Diese Web-Site beinhaltet Daten und Informationen aller Art, die marken und/oder urheberrechtlich zugunsten des Diensteanbieters oder im Einzelfall auch zugunsten Dritter gesch&#252;tzt sind. Es ist daher nicht gestattet, die Web-Site im ganzen oder einzelne Teile davon herunterzuladen, zu vervielf&#228;ltigen und zu verbreiten. Das grunds&#228;tzliche Verbot des Herunterladens der ganzen Web-Site oder einzelner Teile bezieht sich nicht auf ausdr&#252;cklich vom Diensteanbieter zum Download eingestellte Daten, Dokumente, Formulare etc. Gestattet sind weiter die technisch bedingte Vervielf&#228;ltigung zum Zwecke des Browsing, soweit diese Handlung keinen wirtschaftlichen Zwecken dient, sowie die dauerhafte Vervielf&#228;ltigung f&#252;r den eigenen Gebrauch.<br /><br /></p>\r\n<h2>3. Setzen eines Link, Frames</h2>\r\n<p>Es ist gestattet, einen Link auf diese Web-Site zu setzen, soweit er allein der Querreferenz dient. Der Diensteanbieter beh&#228;lt sich das Recht vor, die Gestattung zu widerrufen. Das Framen dieser Web-Site ist nicht gestattet.<br /><br /></p>\r\n<h2>4. Haftung</h2>\r\n<p>Der Diensteanbieter &#252;bernimmt die Haftung f&#252;r die Inhalte seiner Web-Site gem&#228;&#223; den gesetzlichen Bestimmungen. Eine Gew&#228;hr f&#252;r Richtigkeit und Vollst&#228;ndikeit der auf der Web-Site befindlichen Informationen wird nicht &#252;bernommen. Verweise und Links auf Web-Sites Dritter bedeuten nicht, dass sich der Diensteanbieter die hinter dem Verweis oder Link liegenden Inhalte zu eigen macht. Die Inhalte begr&#252;nden keine Verantwortung des Diensteanbieters f&#252;r die dort bereit gehaltenen Daten und Informationen, es sei denn, der Diensteanbieter hat von den Inhalten Kenntnis und es ist ihm technisch m&#246;glich und zumutbar, die Nutzung des Links im Falle rechtswidriger Inhalte zu verhindern. Der Diensteanbieter hat keinen Einflu&#223; auf die hinter dem Link liegenden Inhalte. F&#252;r rechtswidrige, fehlerhafte oder unvollst&#228;ndige Inhalte und Sch&#228;den, die aufgrund der Nutzung von einem hinter dem Link liegenden Inhalt verursacht worden sind, haftet der Diensteanbieter daher nicht.</p>\r\n<p>Die Nutzung des Internets erfolgt auf eigene Gefahr des Nutzers. Der Diensteanbieter haftet vor allem nicht f&#252;r den technisch bedingten Ausfall des Internets bzw. des Zugangs zum Internet.<br /><br /></p>\r\n<h2>5. Gerichtsstand, anwendbares Recht</h2>\r\n<p>Gerichtsstand ist, soweit gesetzlich zul&#228;ssig, am Sitz des Diensteanbieters (Bern). Schweizer Recht ist anwendbar.<br /><br /></p>\r\n<h2>6. Anpassung, salvatorische Klausel</h2>\r\n<p>Der Diensteanbieter beh&#228;lt sich das Recht vor, diese Nutzungbedingungen von Zeit zu Zeit zu modifizieren und sie der technischen sowie rechtlichen Entwicklung anzupassen. Im Falle der Unwirksamkeit einzelner Regelungen dieser Nutzungsvereinbarung bleibt die Wirksamkeit im &#220;brigen unber&#252;hrt. Anstelle der unwirksamen Bestimmung tritt eine Bestimmung, die dem wirtschaftlichen Sinn und Zweck der unwirksamen Regelung am n&#228;chsten kommt. Entsprechendes gilt im Falle einer L&#252;cke in diesen Nutzungsbedingungen.</p>', 'de', '2018-11-26 10:10:41', '2019-01-20 16:53:14', NULL),
