(3, NULL, NULL, '<h1>Conditions d\'utilisation</h1>\r\n<h2>1. G&#233;n&#233;ral</h2>\r\n<p>Ce site Web est soumis aux conditions d\'utilisation suivantes, qui sont convenues entre l\'utilisateur et l\'Union Suisse Distributeurs Opel&#160;(ci-apr&#232;s d&#233;nomm&#233;e \"le fournisseur de services\") lors de la consultation de ce site Web. Dans la mesure o&#249; des conditions particuli&#232;res pour des utilisations individuelles de ce site Web divergent des conditions d\'utilisation, cela sera express&#233;ment indiqu&#233; &#224; l\'endroit appropri&#233; sur le site Web. Les conditions d\'utilisation particuli&#232;res s\'appliquent en outre dans chaque cas particulier.<br /><br /></p>\r\n<h2>2. T&#233;l&#233;chargement / Duplication</h2>\r\n<p>Ce site Web contient des donn&#233;es et des informations de toutes sortes qui sont prot&#233;g&#233;es par des marques et/ou des droits d\'auteur en faveur du prestataire de services ou, dans certains cas, &#233;galement en faveur de tiers. Il est donc interdit de t&#233;l&#233;charger, reproduire ou distribuer le site web en tout ou en partie. L\'interdiction g&#233;n&#233;rale de t&#233;l&#233;charger l\'ensemble du site Web ou certaines parties de celui-ci ne s\'applique pas aux donn&#233;es, documents, formulaires, etc. mis express&#233;ment &#224; disposition pour t&#233;l&#233;chargement par le prestataire de services. En outre, la reproduction techniquement n&#233;cessaire &#224; des fins de navigation est autoris&#233;e, pour autant qu\'elle ne serve pas &#224; des fins &#233;conomiques, de m&#234;me que la reproduction permanente &#224; des fins personnelles.<br /><br /></p>\r\n<h2>3. La mise en place d\'un lien, des images</h2>\r\n<p>Il est permis d\'&#233;tablir un lien vers ce site Web &#224; condition qu\'il ne serve que de r&#233;f&#233;rence crois&#233;e. Le fournisseur de services se r&#233;serve le droit de r&#233;voquer l\'autorisation. Le cadrage de ce site Web n\'est pas autoris&#233;.<br /><br /></p>\r\n<h2>4. Responsabilit&#233;</h2>\r\n<p>Le prestataire de services assume la responsabilit&#233; du contenu de son site Web conform&#233;ment aux dispositions l&#233;gales. Une garantie pour l\'exactitude et l\'exhaustivit&#233; des informations sur le site n\'est pas prise en charge. Les r&#233;f&#233;rences et les liens vers des sites Web tiers ne signifient pas que le fournisseur de services adopte le contenu derri&#232;re la r&#233;f&#233;rence ou le lien comme s\'il s\'agissait du sien. Les contenus ne sauraient engager la responsabilit&#233; du prestataire de services pour les donn&#233;es et informations qui y sont fournies, &#224; moins que le prestataire de services n\'en ait connaissance et qu\'il lui soit techniquement possible et raisonnable d\'emp&#234;cher l\'utilisation du lien en cas de contenus illicites. Le prestataire de services n\'a aucune influence sur le contenu des liens. Le prestataire de services n\'est donc pas responsable des contenus ill&#233;gaux, erron&#233;s ou incomplets et des dommages caus&#233;s par l\'utilisation des contenus derri&#232;re les liens.</p>\r\n<p>L\'utilisation d\'Internet se fait aux risques et p&#233;rils de l\'utilisateur. En particulier, le fournisseur de services n\'est pas responsable de la d&#233;faillance technique de l\'Internet ou de l\'acc&#232;s &#224; l\'Internet.<br /><br /></p>\r\n<h2>5. Lieu de juridiction, droit applicable</h2>\r\n<p>Le for juridique est, dans la mesure o&#249; la loi l\'autorise, le si&#232;ge du prestataire de services (Berne). Le droit suisse est applicable.<br /><br /></p>\r\n<h2>6. Ajustement, clause de divisibilit&#233;</h2>\r\n<p>Le Prestataire se r&#233;serve le droit de modifier les pr&#233;sentes Conditions d\'utilisation de temps &#224; autre et de les adapter aux &#233;volutions techniques et juridiques. En cas de nullit&#233; de certaines dispositions du pr&#233;sent contrat d\'utilisation, la validit&#233; des autres dispositions n\'en sera pas affect&#233;e. La disposition invalide doit &#234;tre remplac&#233;e par une disposition qui se rapproche le plus possible du sens et de l\'objet &#233;conomique de la disposition invalide. Il en va de m&#234;me en cas de lacune dans les pr&#233;sentes conditions d\'utilisation.</p>', 'fr', '2019-01-18 08:22:36', '2019-01-20 16:53:14', NULL),
